function randomNumber(){let e=document.getElementById("img1"),t=Math.floor(5*Math.random()+1),n="./images/dice"+t+".png";e.src=n;let m=document.getElementById("img2"),o=Math.floor(5*Math.random()+1),r="./images/dice"+o+".png";m.src=r;let a=document.querySelector("h1");a.textContent=t>o?"Player 1 wins!":t<o?"Player 2 wins!":"Tie!"}randomNumber();